import sys;

import base64;
import json;
import requests;

config_file = open("config.json", "r");
configuration = json.loads(config_file.read());
config_file.close();

destination = configuration["rest_destination_url"];

if (len(sys.argv) < 2):
	path_to_the_image = "im0162.ppm";
	#print("Please specify the path to the image in command line, e.g. :\n python client.py image.png");
else:
	path_to_the_image = sys.argv[1];

image_file = open(path_to_the_image, "rb");

encoded_image = base64.encodestring(image_file.read());

http_headers = {"content-type": "application/json", "accept": "application/json"};

data = json.dumps({"image_base64": encoded_image.decode()});

result = requests.request(url = destination, data = data, headers = http_headers, method = "POST");

print(result.text);

